    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

    <script>/*
 *  Tile View for remark.js Slides
 *
 *  Garrick Aden-Buie
 *
 *  Inspired and converted to Vanilla JS from
 *  https://github.com/StephenHesperus/remark-hook/
 *
 *  Include after remarkjs slides are initialized.
 *
 */

/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const launchKey = 79 // keycode for O, used to enable tile view

    // Slides container
    const remarkSlideShow = document.querySelector('div.remark-slides-area')

    let tileView = document.querySelector('div.remark__tile-view')
    if (!tileView) {
      tileView = document.createElement('div')
      tileView.className = 'remark__tile-view'
    }

    const toggleElement = el => {
      el.style.display = el.style.display === 'none' ? '' : 'none'
    }

    const toggleTileView = function () {
      toggleElement(tileView)
      toggleElement(remarkSlideShow)

      if (tileView.style.display === 'none') {
        // tileView is now hidden, go to current slide
        slideshow.gotoSlide(tileVars.currentSlideIdx + 1)

        // remove scroll/mousewheel event blocking
        tileView.removeEventListener('mousewheel', blockEvent)
        tileView.removeEventListener('DOMMouseScroll', blockEvent)
        console.log('removing blockScaling')
        document.removeEventListener('keydown', blockScaling)
      } else {
        // store current slide index prior to launching tile-view
        tileVars.currentSlideIdx = slideshow.getCurrentSlideIndex()

        // set class on seen and current slide and scroll into view
        const tiles = tileView.querySelectorAll('.remark__tile-view__tile');
        [...tiles].forEach((tile, idx) => {
          tile.classList.toggle(
            'remark__tile-view__tile--seen',
            idx < tileVars.currentSlideIdx
          )
          tile.classList.toggle(
            'remark__tile-view__tile--current',
            idx === tileVars.currentSlideIdx
          )
        })
        tiles[tileVars.currentSlideIdx].scrollIntoView({
          behavior: 'smooth',
          block: 'center'
        })

        // block remarkjs from handling scroll events
        tileView.addEventListener('mousewheel', blockEvent)
        tileView.addEventListener('DOMMouseScroll', blockEvent)
        console.log('adding blockScaling')
        document.addEventListener('keydown', blockScaling)
      }
    }

    const createTileView = ({ minSize = 250, title = document.title } = {}) => {
      // Tile view header
      const h1 = document.createElement('h1')
      h1.className = 'remark__tile-view__header'
      h1.innerHTML = title

      tileView.appendChild(h1)
      const tiles = document.createElement('div')
      tiles.className = 'remark__tile-view__tiles'
      tileView.appendChild(tiles)

      // Clone slideshow
      const slidesArea = remarkSlideShow.cloneNode(true)

      // Calculate slide scale and tile container size
      const slideScaler = slidesArea.querySelector('.remark-slide-scaler')
      const slideWidth = parseFloat(slideScaler.style.width.replace('px', ''))
      const slideHeight = parseFloat(
        slideScaler.style.height.replace('px', '')
      )
      const scale = minSize / Math.min(slideWidth, slideHeight)
      let tileWidth = Math.round(slideWidth * scale)
      let tileHeight = Math.round(slideHeight * scale)

      // convert tileWidth/Height to em relative to base 18px (set in CSS)
      tileWidth = tileWidth / 18
      tileHeight = tileHeight / 18

      tiles.style.gridTemplateColumns = `repeat(auto-fill, minmax(${tileWidth}em, 1fr))`

      const slides = slidesArea.querySelectorAll('.remark-slide-container')

      slides.forEach((slide, slideIndex) => {
        let tile = document.createElement('template')
        tile.innerHTML = `<div class="remark__tile-view__tile">
            <div class="remark__tile-view__slide-container">
            </div></div>`
        tile = tile.content.firstChild

        const tileContainer = tile.querySelector(
          '.remark__tile-view__slide-container'
        )
        tileContainer.style.width = `${tileWidth}em`
        tileContainer.style.height = `${tileHeight}em`

        const thisSlideScaler = slide.querySelector('.remark-slide-scaler')
        thisSlideScaler.style.top = '0px'
        thisSlideScaler.style.left = '0px'
        thisSlideScaler.style.transform = `scale(${scale})`
        thisSlideScaler.parentElement.classList.add('remark-visible')

        slide.addEventListener('click', () => {
          tileVars.currentSlideIdx = slideIndex
          toggleTileView()
        })

        tileContainer.appendChild(slide)
        tiles.appendChild(tile)
      })

      document.body.appendChild(tileView)
    }

    const tileVars = {}
    const blockEvent = ev => ev.stopPropagation()
    const blockScaling = function (ev) {
      if (ev.controlKey || ev.metaKey) {
        if (ev.key === '=' || ev.key === '-') {
          ev.preventDefault()
          console.log('window scaling is not allowed inside the tile overview')
        }
      }
    }

    document.addEventListener('keydown', ev => {
      if (ev.keyCode === launchKey) {
        toggleTileView()
      }
    })

    const addTileViewHelpText = () => {
      const helpTable = document.querySelector(
        '.remark-help-content table.light-keys'
      )
      if (!helpTable) {
        console.error(
          'Could not find remark help table, has remark been initialized?'
        )
        return
      }
      const newRow = document.createElement('tr')
      newRow.innerHTML += '<td><span class="key">o</span></td>'
      newRow.innerHTML += '<td>Tile View: Overview of Slides</td>'
      helpTable.append(newRow)
    }

    createTileView({ minSize: 200 })
    toggleElement(tileView)
    addTileViewHelpText()
  })
})()
</script>

    <script>/* global slideshow,window,document */
window.xaringanExtraClipboard = function (selector, text) {
  if (!window.ClipboardJS.isSupported()) return
  if (!window.xaringanExtraClipboards) window.xaringanExtraClipboards = {}

  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const {
      button: buttonText = 'Copy Code',
      success: successText = 'Copied!',
      error: errorText = 'Press Ctrl+C to Copy'
    } = text

    const template = '<button class="xaringanextra-clipboard-button" ' +
       `type="button" aria-label="Copy code to clipboard">${buttonText}</button>`

    const isRemarkSlideshow = typeof slideshow !== 'undefined' &&
      Object.prototype.hasOwnProperty.call(slideshow, 'getSlides')

    let siblingSelector = selector || 'pre'
    if (!selector && isRemarkSlideshow) {
      siblingSelector = '.remark-slides-area ' + siblingSelector
    }

    // insert <button>s
    document.querySelectorAll(siblingSelector).forEach(el => {
      if ([/^$/, 'inherit', 'unset', 'revert', 'static'].some(p => el.style.position.match(p))) {
        el.style.position = 'relative'
      }
      el.insertAdjacentHTML('beforeend', template)

      // match button text color to code color
      const currentColor = window.getComputedStyle(el.children[0]).getPropertyValue('color')
      el.querySelector('button.xaringanextra-clipboard-button').style.color = currentColor
    })

    // initialize cliboardjs
    const clipboard = new window.ClipboardJS(siblingSelector + ' .xaringanextra-clipboard-button', {
      text: function (trigger) {
        // temporarily remove the button text
        // so that it isn't included in the text that's copied
        const btnLabel = trigger.innerHTML
        trigger.innerHTML = ''
        // snapshot text of copy button's parent element
        const text = trigger.parentElement.innerText
        // restore the button's inner HTML
        trigger.innerHTML = btnLabel
        return text
      }
    })

    // show success text for 2.5 seconds on success
    clipboard.on('success', function (ev) {
      ev.trigger.innerHTML = successText
      ev.trigger.style.display = 'block'
      setTimeout(function () {
        ev.trigger.innerHTML = buttonText
        ev.trigger.style.display = ''
      }, 2500)
      ev.clearSelection()
    })

    // show error text for 2.5 seconds on error
    clipboard.on('error', function (ev) {
      ev.trigger.innerHTML = errorText
      setTimeout(function () { ev.trigger.innerHTML = buttonText }, 2500)
    })

    // block remark click/touch slide change event listeners
    if (isRemarkSlideshow) {
      ['touchstart', 'touchend', 'touchmove'].forEach(function (evType) {
        document.querySelector('.remark-slides-area').addEventListener(evType, function (ev) {
          if (!ev.target.closest('pre')) return
          if (ev.target.closest('pre').querySelector('.xaringanextra-clipboard-button')) {
            ev.stopPropagation()
          }
        })
      })
    }

    window.xaringanExtraClipboards[siblingSelector] = clipboard
  })
}

## What is `ggplot2`?

`ggplot2` is well-known for creating plots.
Thanks to our `sf` working environment, we can exploit all amazing `ggplot2` functions.
Trust us, before `sf`, making maps was way more complicated.

--

In general, on `ggplot2`:

- well-suited for multi-dimensional data
- expects data (frames) as input
- components of the plot are added as layers


```r
plot_call +
  layer_1 +
  layer_2 +
  ... +
  layer_n
```

---

## From `tmap` to `ggplot2`

Reminder: We played around with `tmap` yesterday, and the results were already pretty nice.
`ggplot2` allows us to customize our maps even more, draw on previous knowledge of the package and increase the possibilities to combine maps, plots, and more.

The good thing: the inner logic of `tmap` and `ggplot2` is the same and is based on the *grammar of graphics*.

--

If you are new to `ggplot2`, you might want to check out:
  - [ggplot2 - Elegant Graphics for Data Analysis](https://www.springer.com/gp/book/9783319242750) by Hadley Wickham
  - [BBC Visual and Data Journalism cookbook for R graphics](https://bbc.github.io/rcookbook/#how_to_create_bbc_style_graphics)
  - [ggplot2 extensions](http://www.ggplot2-exts.org/gallery/)


---

## Components of a Plot

According to Wickham ([2010, 8](http://dx.doi.org/10.1198/jcgs.2009.07098)), a layered plot consists of the following components:

- data and aesthetic mappings,
- geometric objects,
- scales,
- (and facet specification)


```r
plot_call +
  data +
  aesthetics +
  geometries +
  scales +
  facets
```

## Let us start building some maps!

First: Get the data!


```r
library(sf)
library(ggplot2)

attributes_districts &lt;-  read.csv(&quot;./data/attributes_districts.csv&quot;, 
                                  header = T, fill = T, sep = &quot;,&quot;) 

german_districts_enhanced &lt;- st_read(dsn = &quot;./data&quot;,
                           layer = &quot;GER_DISTRICTS&quot;) %&gt;% 
                           rename(., district_id = id) %&gt;% 
                          st_transform(., crs = 3035) %&gt;% 
                          left_join(., attributes_districts, by = &quot;district_id&quot;)
                                  
german_states &lt;- st_read(dsn = &quot;./data&quot;, layer = &quot;GER_STATES&quot;) %&gt;% 
                  st_transform(. , 3035)
```

## Making a Plan

This map will be our canvas for the ongoing session.
There are hundreds of options to change this map.
We will cover at least some essential building blocks:

  - *THE MAP*: adding attributes, choose from colors/palettes, adding layers
  - *THE LEGEND*: position, sizes, display
  - *THE ENVIRONMENT*: choosing from themes and build your own
  - *THE META-INFORMATION*: titles and sources
  - *THE EXTRAS*: scales and compass

--

If your working on your maps, the [ggplot2 cheatsheets](https://rstudio.com/wp-content/uploads/2016/11/ggplot2-cheatsheet-2.1.pdf) will help you with an overview of scales, themes, labels, facets, and more.

## Add the `aesthetics` 

We&#39;ll concentrate on mapping the vote share of the German Right-Wing Populist Party (*AfD*) in the German Federal Election in 2017.

.pull-left[

```r
# map aethetics
ggplot() +
  geom_sf(data = german_districts_enhanced, 
       # add the attribute we want to map
        aes(fill = afd_voteshare_2017)) + 
      # choose a continuous palette 
        scale_fill_continuous() 
```

## The Map Layer 

Are you having trouble choosing the right color? There are some excellent tutorials out there, f.e. by [Michael Toth](https://michaeltoth.me/a-detailed-guide-to-ggplot-colors.html).

.pull-left[

```r
# change color palette
ggplot() +
  geom_sf(data = german_districts_enhanced,
          aes(fill = afd_voteshare_2017)) + 
  # readable with color vision deficiencies
    scale_fill_viridis_c(option = &quot;plasma&quot;) 

# other option:
scale_fill_continuous(type = &quot;viridis&quot;)
# or build you own continous palette:
scale_color_gradient

## Add another Shapefile 

.pull-left[

```r
# realizing that my shapefile includes
# polygons of oceans and lakes
# easy fix on the fly when you know your data
german_states &lt;-
  german_states %&gt;% 
  filter(., GF == 4 )

# add layer with German states
ggplot() +
  geom_sf(data = german_districts_enhanced, 
          aes(fill = afd_voteshare_2017), 
          color = NA) + 
  scale_fill_viridis_c(option = &quot;plasma&quot;, 
                       direction = -1) +
   # add another layer
  geom_sf(data = german_states, 
          # filling transparent
          fill = &quot;transparent&quot;,
          # color of borders
          color = &quot;white&quot;, 
          # size of borders
          size = 1) 
```
]

## Dealing with the Legend 

You can deal with everything concerning the legend (labels, titles, width...) within the scale argument.
The only thing you cannot change here is the position in relation to the map.

.pull-left[

```r
ggplot() +
  geom_sf(data = german_districts_enhanced, 
          aes(fill = afd_voteshare_2017), 
          color = NA) + 
  scale_fill_viridis_c(option = &quot;plasma&quot;,
                       direction = -1,
                    # add a legend title
                    name = &quot;AfD Vote Share&quot;,
                    # adjust legend
                    guide = guide_legend (
                    # turn it horizontal
                    direction= &quot;horizontal&quot;,
                    # put the labels
                    # under the legend bar
                    label.position = &quot;bottom&quot;)) + 
  geom_sf(data = german_states, 
          fill = &quot;transparent&quot;, 
          color = &quot;white&quot;) 

# check the help file for more options
?guide_legend
```
]


.pull-right[
&lt;img src=&quot;data:image/png;base64,#2_3_Advanced_Maps_I_files/figure-html/legend-plot-1.png&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]

## Save and Reuse

Maps produced with `ggplot2` are standard objects like any other object in `R` (they are lists). We can just assign them to re-use, plot later, and add map layers.

Furthermore, you can save them just as any `ggplot2` graph.
The `ggsave()` function automatically detects the file format. You can also define the height, width, and dpi, which is particularly useful to produce high-class graphics for publications.

---

## Save and Reuse



```r
# assign to object
afd_map &lt;- 
ggplot() +
  geom_sf(data = german_districts_enhanced, 
          aes(fill = afd_voteshare_2017), 
          color = NA) + 
  scale_fill_viridis_c(option = &quot;plasma&quot;,
                       direction = -1,
                    name = &quot;AfD Vote Share&quot;,
                    guide = guide_legend (
                    direction= &quot;horizontal&quot;,
                    label.position = &quot;bottom&quot;)) + 
  geom_sf(data = german_states, 
          fill = &quot;transparent&quot;, 
          color = &quot;white&quot;) 
 
# save as png-file
ggsave(&quot;afd_map.png&quot;, afd_map, dpi = 300)
```

## The overall `theme` of your map 

.pull-left[

```r
afd_map &lt;- 
ggplot() +
  geom_sf(data = german_districts_enhanced, 
          aes(fill = afd_voteshare_2017), 
          color = NA) + 
  scale_fill_viridis_c(option = &quot;plasma&quot;,
                       direction = -1,
                    name = &quot;AfD Vote Share&quot;,

                    label.position = &quot;bottom&quot;)) + 
  geom_sf(data = german_states, 
          fill = &quot;transparent&quot;,

## Get rid of everything?!

The `theme` controls all &#39;non-data&#39; display.
If you want to get rid of the default `ggplot2` theme, you can do so.
But instead of getting rid of everything, you might want to try out the built-in themes.

.pull-left[

```r
# use the object afd_map as base layer
afd_map +
  # empty your theme
  theme_void() 


# ... or add another
theme_bw()
theme_gray()
theme_light()

# check all themes here
?theme
```

## Adding `labs`

There is one necessary step to do. You should always make sure to include and cite your data sources. Especially in graphs and maps, you can use a short version to include them in the description directly.

  labs(title = &quot;Electoral Success AfD&quot;,

## Creating a city layer for city labels



```r
# create a german city layer by choosing the five districts
# with the highest pop density

german_cities &lt;-
  german_districts_enhanced %&gt;% 
  # calculate pop_dens
  mutate(pop_dens = population / 
           st_area(german_districts_enhanced)) %&gt;% 
  # filter top 5 observation with highs pop_dens
  top_n( . , 5, pop_dens) %&gt;% 
  # take the centroid of each polygon and turn to
  # polygon file into a shapefile
  st_centroid() %&gt;% 
  # add the coordinates as X and Y column
  bind_cols(. , as.data.frame(st_coordinates(.))) %&gt;% 
  # add some city names as labels
  bind_cols(. , data.frame(names = c(&quot;City 1&quot;, 
                                 &quot;City 2&quot;, 
                                 &quot;City 3&quot;, 
                                 &quot;City 4&quot;, 
                                 &quot;City 5&quot;)))

german_cities %&gt;% 
  dplyr::select(.,pop_dens, X, Y)
```

## Having fun with point layers...

... and moving around the labels with the package `ggrepel`.

.pull-left[

```r
afd_map +
  # add cities as point layers
    geom_point(data = german_cities,

             # color of points

             # transparency of points
                  alpha = 0.6,
             # size of points
                  size = 5) +
  # ggrepel to move geometric objects
  ggrepel::geom_label_repel(data = german_cities, 
                            # the coordinates as columns

                                label = names),
                            size = 3,
                            alpha = .8,
                            # connect label and 
                            #original data oint via line
                            min.segment.length = unit(0, &#39;lines&#39;))

## `ggplot2` and raster data

You can also use `ggplot2` to create maps with `raster data`. There are several ways to do so, but Stefan recommends the `geom_stars` building block. Here an example with some (small) adjustments.

.pull-left[

```r
cologne_immigrants &lt;-
  raster::raster(&quot;../../data/immigrants_cologne.tif&quot;)

ggplot() +
  stars::geom_stars
(data = stars::st_as_stars(cologne_immigrants)) +
  # add for fixed &quot;aspect ratio&quot;
  coord_equal() +
  # set na values transparent
  scale_fill_continuous(na.value = &quot;transparent&quot;) +
  # remove theme
  theme_void()
```
]

## Where `ggplot2` cannot help anymore

  
In some specific circumstances, we might realize that `ggplot2` is super powerful but just not designed to build maps.
Typical features of maps are not in the package, like a compass or scale bars.

This is where other packages might need to be installed. The good thing:
Elements of the package `ggsn` can be included as `ggplot2` layer.
Checkout [Github](http://oswaldosantos.github.io/ggsn/).

---

## The Extras

`ggsn` allows you to add, f.e. a scale bar and a north arrow.

.pull-left[

```r
# add scalebar and north arrow
afd_map +
  ggsn::scalebar(data = german_districts_enhanced, 
                 dist = 100, 
                 dist_unit =&quot;km&quot;, 
                 transform = F,
                 location = &quot;bottomright&quot;, 
                 st.bottom = T, 
                 st.size = 2.5) +
  ggsn::north(data = german_districts_enhanced, 
              location = &quot;bottomleft&quot;)
```

## ... and the code behind it ...


```r
# Adjust the original AfD map
afd_map_adj &lt;-
  ggplot() +
    geom_sf(data = german_districts_enhanced, 
            aes(fill = afd_voteshare_2017), 
            color = NA) + 
    scale_fill_viridis_c(option = &quot;plasma&quot;,
                         direction = -1,
                         name = &quot;AfD Vote Share&quot;,
                         guide = FALSE) + 
    geom_sf(data = german_states, 
            fill = &quot;transparent&quot;, 
            color = &quot;white&quot;) +
    theme_void()

# Subsetting the data to NRW
nrw_districts_enhanced &lt;-
  german_districts_enhanced %&gt;% 
  filter( district_id &gt;= 5000 &amp; district_id &lt; 6000 )

# Getting the boundary box of NRW
bbox_nrw &lt;-
  st_as_sfc(st_bbox
            (nrw_districts_enhanced))

# drawing a black rectangle on our AfD Map
afd_map_box &lt;-
  afd_map_adj + 
  geom_sf(data = bbox_nrw, 
          fill = NA, color = &quot;black&quot;, size = 1.2) +
  theme_void()
```

# making the NRW Map

# inset map

inset_map
